ted with the latest technologies.</span></p><p class="c31 c36"><span class="c6 c32 c43"></span></p><p class="c27 c46"><span class="c23 c20">SKILLS</span></p><p class="c26 c40 title"><span class="c6 c32 c33"></span></p><ul class="c21 lst-kix_list_1-0 start"><li class="c18 title li-bullet-0"><span class="c14">Backend Development:</span><span class="c6 c14 c20">&nbsp;</span></li></ul><p class="c45 title"><span class="c4">Skilled in </span><span class="c4">PHP</span><span class="c4">, </span><span class="c4">Laravel</span><span class="c4">, </span><span class="c4">Jetstream</span><span class="c4">, </span><span class="c4">RESTful APIs</span><span class="c4">, </span><span class="c4">authentication</span><span class="c4">, </span><span class="c4">middleware</span><span class="c4">, and </span><span class="c4">SPA</span><span class="c6 c4">&nbsp;development.</span></p><ul class="c21 lst-kix_list_1-0"><li class="c18 title li-bullet-0" id="h.94c01k157zf5"><span class="c14">Frontend Development:</span><span class="c6 c14 c20">&nbsp;</span></li></ul><p class="c30 title" id="h.d2evt6kclum3"><span class="c4">&nbsp; &nbsp; JavaScript, </span><span class="c4">Vue.js</span><span class="c6 c4">, HTML, CSS, Bootstrap, AJAX</span></p><ul class="c21 lst-kix_list_1-0"><li class="c18 title li-bullet-0" id="h.h6uypdagfhqh"><span class="c14">Database Management</span><span class="c4">:</span><span class="c6 c4">&nbsp;</span></li></ul><p class="c30 title" id="h.qgo2z6fu4axr"><span class="c4">&nbsp; &nbsp; </span><span class="c4">MySQL</span><span class="c4">, query optimization, migrations, and Eloquent ORM.</span></p><ul class="c21 lst-kix_list_1-0"><li class="c18 title li-bullet-0"><span class="c14">Website &amp; Server Management:</span><span class="c6 c4">&nbsp;</span></li></ul><p class="c30 title"><span class="c6 c4">&nbsp; &nbsp; Development, deployment, and maintenance of websites, managing web servers, databases, </span></p><p class="c30 title"><span class="c4">&nbsp; &nbsp; and ho